import styled, { ThemeProvider } from 'styled-components';
import theme from '../../resource/css/theme';
import CommonBtn from '../common/CommonBtn';

function Header() {
    const menu = ['Features', 'Download', 'Q&A'];
    const style = {
        padding: '14px 32px',
        fontSize: '14px',
    };

    return (
        <HeaderWrap>
            <HeaderContainer>
                <img src="images/logo-bookmark.svg" alt="" />
                <Gnb>
                    {menu.map((menu, index) => (
                        <button key={index}>{menu}</button>
                    ))}
                </Gnb>
                <CommonBtn style={{ style }} color={'red'} text={'LOGIN'} />
            </HeaderContainer>
        </HeaderWrap>
    );
}

const HeaderWrap = styled.div``;

const HeaderContainer = styled.div`
    ${({ theme }) => theme.mixin.layourFrame};
    display: flex;
    justify-content: space-between;
    align-items: center;
    padding-top: 48px;

    .btn-login {
    }
`;
const Logo = styled.div`
    width: 150px;
    height: 30px;
    background: url(images/logo-bookmark.svg);
`;
const Gnb = styled.nav``;

export default Header;
